import React from "react";

import "./Sidebar.scss";
const sidebar = (props) => {
  return (
    <div className="sidebar">
      <h1 class="logo">
        <span class="text-primary">
          <i class="fas fa-book-open"></i> Flake
        </span>
        Software
      </h1>
      <nav>
        <a href="#">
          <i class="fa fa-pied-piper"></i> Overview
        </a>
        <a href="#">
          <i class="fa fa-book" aria-hidden="true"></i> Collections
        </a>
        <a href="#">
          <i class="fa fa-user-o"></i> Clients
        </a>
        <a>
          <i class="fa fa-area-chart" aria-hidden="true"></i> Analytics
        </a>
      </nav>
    </div>
  );
};

export default sidebar;
